function getByID(a){return document.getElementById(a)}function getByTag(a){return document.getElementsByTagName(a)}function getElementsByClass(a){return document.getElementsByClassName(a)}function filterInt(a){return/^(\-|\+)?([0-9]+|Infinity)$/.test(a)?Number(a):NaN}function filterEmail(a){return/^([\w+-.%]+@[\w\-.]+\.[A-Za-z]{2,4},*[\W]*)+$/.test(a)?!0:!1}function filterFloat(a){return/^(\-|\+)?([0-9]+(\.[0-9]+)?|Infinity)$/.test(a)?Number(a):NaN}
function getRandomInt(a,b){return Math.floor(Math.random()*(b-a+1))+a}function getRandomArbitrary(a,b){return Math.random()*(b-a)+a}var generatedNumbers=[];function generateRandomNumber(a){if(20>=a){var b=Math.pow(10,a),c=Math.round(Math.random().toFixed(a)*b);if(-1<generatedNumbers.indexOf(c))return generatedNumbers.length==b?"Generated all values with this number of digits":generateRandomNumber(a);generatedNumbers.push(c);return c}return"Number of digits should not exceed 20!"}
function submitSortForm(a,b){getByID("sortType").value=a;getByID(b).submit()}function submitDelete(a,b,c){getByID("deleteUsername").value=a;submitDomainDelete(b,c)}function submitDomainDelete(a,b){getByID("deleteDomain").value=a;getByID(b).submit()}function submitAliasDelete(a,b,c,d,e){getByID("deleteAliasS").value=a+"@"+b;getByID("deleteAliasD").value=c+"@"+d;getByID(e).submit()}
function onReady(a){"loading"!=document.readyState?a():document.addEventListener?document.addEventListener("DOMContentLoaded",a):document.attachEvent("onreadystatechange",function(){"loading"!=document.readyState&&a()})}function varDump(a){var b="",c;for(c in a)b+=c+": "+a[c]+"\n";console.log(b)};